import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';



const TaskLists = ({ id, name }) => {
  return (
    <li>
      <span> <FontAwesomeIcon icon="fa-solid fa-circle-ellipsis" />
        {name}
      </span>
      <span>5</span>
    </li>
  );
};

export default TaskLists;
